constructor("Model.Relations.Relation", {
  has_operands: true,

  initialize_events_system: function() {
    this.on_insert_node = new SubscriptionNode();
    this.on_remove_node = new SubscriptionNode();
    this.on_update_node = new SubscriptionNode();
    if (this.has_operands) {
      this.operands_subscription_bundle = new SubscriptionBundle();
      this.unsubscribe_from_operands_when_this_relation_no_longer_has_subscribers();
    }
  },

  where: function(predicate) {
    return new Model.Relations.Selection(this, predicate);
  },

  order_by: function() {
    var self = this;
    var order_by_columns = Util.map(Util.to_array(arguments), function(order_by_column) {
      if (order_by_column instanceof Model.OrderByColumn) {
        return order_by_column;
      } else if (order_by_column instanceof Model.Column) {
        return order_by_column.asc();
      } else if (typeof order_by_column == "string") {
        var parts = order_by_column.split(/ +/);
        var column_name = parts[0];
        var direction = parts[1] || 'asc';
        if (direction == 'desc') {
          return self.primary_table().columns_by_name[column_name].desc();
        } else {
          return self.primary_table().columns_by_name[column_name].asc();
        }
      } else {
        throw new Error("You can only order by Columns, OrderByColumns, or 'column_name direction' strings");
      }
    });

    return new Model.Relations.Ordering(this, order_by_columns);
  },

  each: function(fn) {
    Util.each(this.all(), fn);
  },

  empty: function() {
    return this.all().length == 0;
  },

  first: function() {
    return this.all()[0];
  },

  at: function(i) {
    return this.all()[i];
  },
  
  on_insert: function(on_insert_callback) {
    this.subscribe_to_operands_if_needed();
    return this.on_insert_node.subscribe(on_insert_callback);
  },

  on_remove: function(on_remove_callback) {
    this.subscribe_to_operands_if_needed();
    return this.on_remove_node.subscribe(on_remove_callback);
  },

  on_update: function(on_update_callback) {
    this.subscribe_to_operands_if_needed();
    return this.on_update_node.subscribe(on_update_callback);
  },

  has_subscribers: function() {
    return !(this.on_insert_node.empty() && this.on_remove_node.empty() && this.on_update_node.empty());
  },

  fetch: function() {
    return Server.fetch([this]);
  },

  memoize_records: function() {
    this.records = this.all();
  },

  record_inserted: function(record) {
    this.records.push(record)
    this.on_insert_node.publish(record);
  },

  record_removed: function(record) {
    Util.remove(this.records, record);
    this.on_remove_node.publish(record);
  },

  record_updated: function(record, update_data) {
    this.on_update_node.publish(record, update_data);
  },

  contains: function(record) {
    var records = this.all();
    for(var i = 0; i < records.length; i++) {
      if (records[i] == record) return true;
    }
    return false;
  },

  subscribe_to_operands_if_needed: function() {
    if (this.has_operands && !this.has_subscribers()) this.subscribe_to_operands();
  },

  unsubscribe_from_operands_when_this_relation_no_longer_has_subscribers: function() {
    var self = this;
    var unsubscribe_callback = function() {
       if (!self.has_subscribers()) self.unsubscribe_from_operands();
    };

    this.on_insert_node.on_unsubscribe(unsubscribe_callback);
    this.on_remove_node.on_unsubscribe(unsubscribe_callback);
    this.on_update_node.on_unsubscribe(unsubscribe_callback);
  },

  unsubscribe_from_operands: function() {
    this.operands_subscription_bundle.destroy_all();
    this.records = null;
  }
});
constructor("Model.Relations.Table", Model.Relations.Relation, {
  has_operands: false,

  initialize: function(global_name, record_constructor) {
    this.global_name = global_name;
    this.record_constructor = record_constructor;
    this.columns_by_name = {};
    this.synthetic_columns_by_name = {};
    this.records = [];
    this.records_by_id = {};

    this.initialize_events_system();
  },

  define_column: function(name, type) {
    return this.columns_by_name[name] = new Model.Column(this, name, type);
  },

  define_synthetic_column: function(name, definition) {
    return this.synthetic_columns_by_name[name] = new Model.SyntheticColumn(this, name, definition);
  },

  column: function(name) {
    return this.columns_by_name[name];
  },

  all: function() {
    return this.records.concat();
  },

  insert: function(record) {
    this.records_by_id[record.id()] = record;
    this.record_inserted(record);
  },

  remove: function(record) {
    delete this.records_by_id[record.id()];
    this.record_removed(record);
  },

  //TODO: replace with Selection-based find
  find: function(id) {
    return this.records_by_id[id];
  },

  wire_representation: function() {
    return {
      type: 'table',
      name: this.global_name
    };
  },

  pause_events: function() {
    this.on_insert_node.pause_events();
    this.on_remove_node.pause_events();
    this.on_update_node.pause_events();
  },

  resume_events: function() {
    this.on_insert_node.resume_events();
    this.on_remove_node.resume_events();
    this.on_update_node.resume_events();
  },

  update: function(dataset) {
    var self = this;
    Util.each(dataset, function(id, attributes) {
      var extant_record = self.find(id);
      if (extant_record) {
        extant_record.local_update(attributes);
      } else {
        self.record_constructor.local_create(attributes)
      }
    });
  },

  fixtures: function(fixture_definitions) {
    this.fixture_definitions = fixture_definitions;
  },

  load_fixtures: function() {
    if (!this.fixture_definitions) return;
    var self = this;
    Util.each(this.fixture_definitions, function(id, properties) {
      var attributes = jQuery.extend({id: id}, properties)
      self.insert(new self.record_constructor(attributes));
    });
  },

  clear: function() {
    this.records = [];
  },

  clone_schema: function() {
    var clone = new Model.Relations.Table(this.global_name, this.record_constructor);
    clone.columns_by_name = this.columns_by_name;
    return clone;
  },

  evaluate_in_repository: function(repository) {
    return repository.tables[this.global_name];
  },

  primary_table: function() {
    return this;
  }
});
constructor("Model.Relations.Selection", Model.Relations.Relation, {

  initialize: function(operand, predicate) {
    this.operand = operand;
    this.predicate = predicate;
    this.initialize_events_system();
  },

  all: function() {
    if (this.records) return this.records;

    var predicate = this.predicate;
    var all = [];
    this.operand.each(function() {
      if (predicate.evaluate(this)) all.push(this);
    });
    return all;
  },

  wire_representation: function() {
    return {
      type: "selection",
      operand: this.operand.wire_representation(),
      predicate: this.predicate.wire_representation()
    };
  },

  subscribe_to_operands: function() {
    this.memoize_records();

    var self = this;
    this.operands_subscription_bundle.add(this.operand.on_insert(function(record) {
      if (self.predicate.evaluate(record)) self.record_inserted(record);
    }));

    this.operands_subscription_bundle.add(this.operand.on_remove(function(record) {
      if (self.predicate.evaluate(record)) self.record_removed(record);
    }));

    this.operands_subscription_bundle.add(this.operand.on_update(function(record, changed_fields) {
      if (self.contains(record)) {
        if (self.predicate.evaluate(record)) {
          self.record_updated(record, changed_fields);
        } else {
          self.record_removed(record);
        }
      } else {
        if (self.predicate.evaluate(record)) self.record_inserted(record);
      }
    }));
  },

  evaluate_in_repository: function(repository) {
    return new Model.Relations.Selection(this.operand.evaluate_in_repository(repository), this.predicate);
  },

  primary_table: function() {
    return this.operand.primary_table();
  }
});
constructor("Model.Relations.Ordering", Model.Relations.Relation, {
  initialize: function(operand, order_by_columns) {
    this.operand = operand;
    this.order_by_columns = order_by_columns;

    var self = this;
    this.comparator = function(a, b) {
      for(var i = 0; i < self.order_by_columns.length; i++) {
        var order_by_column = self.order_by_columns[i]
        var column = order_by_column.column;
        var direction_coefficient = order_by_column.direction_coefficient;

        var a_value = a.field(column).value();
        var b_value = b.field(column).value();

        if (a_value < b_value) return -1 * direction_coefficient;
        else if (a_value > b_value) return 1 * direction_coefficient;
      }
      return 0;
    }
    this.initialize_events_system();
  },

  all: function() {
    return this.operand.all().sort(this.comparator);
  },

  evaluate_in_repository: function(repository) {
    return new Model.Relations.Ordering(this.operand.evaluate_in_repository(repository), this.order_by_columns);
  },

  primary_table: function() {
    return this.operand.primary_table();
  },

  wire_representation: function() {
    return this.operand.wire_representation();
  },

  subscribe_to_operands: function() {
    this.memoize_records();

    var self = this;
    this.operands_subscription_bundle.add(this.operand.on_insert(function(record) {
      self.record_inserted(record);
    }));

    this.operands_subscription_bundle.add(this.operand.on_remove(function(record) {
      self.record_removed(record);
    }));

    this.operands_subscription_bundle.add(this.operand.on_update(function(record, changed_fields) {
      self.record_updated(record, changed_fields);
    }));
  }
})
